import './index.scss'
import React, { useEffect,useState } from 'react'
import {
    Container,
    Table,
    TableBody,
    TableContainer,
    TableHead,
    TableFooter,
    TableRow,
    Button
  } from '@mui/material'
import { Grid, TextField, Paper } from '@material-ui/core'
const MangePartnerPage=()=>{
    const [status, setStatus] = useState('')
    const [Operator, setOperator] = useState('')
    const statusOptions = [
        { id: 'ALL', title: 'All', color: '' },
        { id: 'ONL', title: 'Online', color: 'green' },
      ]

    return(
        <Container className='mangepartner-container'>

            <Paper className='paper-header'> 
                <Grid container className="searchBar">
                    <Grid item xs={12} sm={12} md={4} lg={3}>
                        <TextField
                            className="filterFormInput"
                            label="Operator Name"
                            placeholder={'Enter operator name'}
                            variant={'outlined'}
                            fullWidth
                            margin={'normal'}
                            InputLabelProps={{
                                shrink: true
                            }}
                            value={Operator}

                        />
                    </Grid>
                    <Grid item xs={12} sm={12} md={4} lg={3} >
                        <TextField
                            className="filterForm"
                            label="Status"
                            select
                            SelectProps={{
                                native: true
                            }}
                            variant="outlined"
                            margin="normal"
                            fullWidth
                            InputLabelProps={{
                                shrink: true
                            }}
                            size="medium"

                            onChange={(e) => setStatus(e.target.value)}
                            >
                            <option key={''} value={''} hidden>
                                Choose status
                            </option>
                            {statusOptions.map((option, i) => (
                                <option key={`status-option-${i}`} value={option.id} className="option-color">
                                {option.title}
                                </option>
                            ))}
                        </TextField>
                    </Grid>
                    <Grid item xs={2} sm={2} md={1} lg={1}>
                        <Button className="buttonSearchDefault" variant="contained"

                        >
                        Search
                        </Button>
                    </Grid>
                    <Grid item sm={'auto'} md={'auto'} lg={3}>
                    </Grid>
                </Grid>
            </Paper>
        </Container>
    );
}
export default MangePartnerPage;
